import React from "react";
import Header from '../Header';
import Stats from "./Stats";
import {Fragment } from 'react';
import OngoingTasksHome from "./OngoingTasksHome";
import PendingTasksHome from "./PendingTasksHome";
import AddTaskButton from "../AddTaskButton";
import BacklogTasks from "./BacklogTasks";

const HomePage = props =>{
    
    return(
        <Fragment>
        <Header></Header>
        <Stats></Stats>
        <OngoingTasksHome button={true}/>
        <PendingTasksHome button={true}/>
        <BacklogTasks button={false}/>
        <AddTaskButton/>
        </Fragment>
    );
}

export default HomePage;
